import React from "react";
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import BarContainer from "./bar";

const Navbar = () => {
    return (
        <AppBar position="static" id = "Lp_navbar">
            <Toolbar>
                <BarContainer/>
            </Toolbar>
        </AppBar>
    )
}

export default Navbar;
